import{_ as a,a as r,b as o}from"./chunks/pixhack_v5_debug.D1_dDAaI.js";import{_ as l,E as i,c as n,J as s,m as t,a as d,ab as c,o as p}from"./chunks/framework.CUflZczI.js";const A=JSON.parse('{"title":"CUAV v5 (Discontinued)","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_controller/cuav_v5.md","filePath":"zh/flight_controller/cuav_v5.md"}'),h={name:"zh/flight_controller/cuav_v5.md"},u=t("h1",{id:"cuav-v5-discontinued",tabindex:"-1"},[d("CUAV v5 (Discontinued) "),t("a",{class:"header-anchor",href:"#cuav-v5-discontinued","aria-label":'Permalink to "CUAV v5 (Discontinued)"'},"​")],-1),m=c('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>This flight controller has been <a href="./../flight_controller/autopilot_experimental.html">discontinued</a> and is no longer commercially available.</p></div><div class="warning custom-block"><p class="custom-block-title">PX4 does not manufacture this (or any) autopilot. Contact the <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">manufacturer</a> for hardware support or compliance issues.</p></div><p><em>CUAV v5</em><sup>®</sup> (previously &quot;Pixhack v5&quot;) is an advanced autopilot designed and made by CUAV<sup>®</sup>. The board is based on the <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk-project</a> <strong>FMUv5</strong> open hardware design. It runs PX4 on the <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a> OS, and is fully compatible with PX4 firmware. It is intended primarily for academic and commercial developers.</p><p><img src="'+a+'" alt="CUAV v5"></p><h2 id="快速预览" tabindex="-1">快速预览 <a class="header-anchor" href="#快速预览" aria-label="Permalink to &quot;快速预览&quot;">​</a></h2><ul><li><p>主处理器：STM32F765</p><ul><li>32 位 Arm® Cortex®-M7，216MHz，2MB 储存，512KB RAM</li></ul></li><li><p>IO 处理器：STM32F100</p><ul><li>32 位 Arm® Cortex®-M3，24MHz，8KB SRAM</li></ul></li><li><p>内置传感器：</p><ul><li>加速度计/陀螺仪：ICM-20689</li><li>加速度计/陀螺仪：BMI055</li><li>磁力计：IST8310</li><li>气压计：MS5611</li></ul></li><li><p>接口：</p><ul><li>14路PWM输出 (6路来自FMU, 8路来自 IO)</li><li>FMU上有3个专用PWM/Capture输入</li><li>CPPM专用的RC输入</li><li>Dedicated R/C input for PPM and S.Bus</li><li>电平/PWM RSSI输入</li><li>S.BUS伺服输出</li><li>5个通用串行口</li><li>4路I2C总线</li><li>4路SPI总线</li><li>2 CANBuses with serial ESC</li><li>2个电池电流/电压模拟输入口</li></ul></li><li><p>电源系统：</p><ul><li>输入电压：4.3~5.4V</li><li>USB输入电压: 4.75~5.25V</li><li>伺服导轨输入电压：0~36V</li></ul></li><li><p>重量和尺寸:</p><ul><li>重量：99g</li><li>尺寸：44<em>84</em>12mm</li></ul></li><li><p>其它特性:</p><ul><li>工作温度：-20 ~ 80°C （实测值）</li></ul></li></ul><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><p>Order from <a href="https://cuav.taobao.com/index.htm?spm=2013.1.w5002-16371268426.2.411f26d9E18eAz" target="_blank" rel="noreferrer">CUAV</a>.</p><h2 id="接口定义" tabindex="-1">接口定义 <a class="header-anchor" href="#接口定义" aria-label="Permalink to &quot;接口定义&quot;">​</a></h2><p><img src="'+r+'" alt="CUAV v5"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>The RCIN interface is limited to powering the rc receiver and cannot be connected to any power/load.</p></div><h2 id="额定电压" tabindex="-1">额定电压 <a class="header-anchor" href="#额定电压" aria-label="Permalink to &quot;额定电压&quot;">​</a></h2><p><em>CUAV v5</em> can be triple-redundant on the power supply if three power sources are supplied. The three power rails are: <strong>POWER1</strong>, <strong>POWER2</strong> and <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">The output power rails <strong>FMU PWM OUT</strong> and <strong>I/O PWM OUT</strong> (0V to 36V) do not power the flight controller board (and are not powered by it). You must supply power to one of <strong>POWER1</strong>, <strong>POWER2</strong> or <strong>USB</strong> or the board will be unpowered.</p></div><p><strong>Normal Operation Maximum Ratings</strong></p><p>Under these conditions all power sources will be used in this order to power the system:</p><ol><li><strong>POWER1</strong> and <strong>POWER2</strong> inputs (4.3V to 5.4V)</li><li><strong>USB</strong> input (4.75V to 5.25V)</li></ol><h2 id="编译固件" tabindex="-1">编译固件 <a class="header-anchor" href="#编译固件" aria-label="Permalink to &quot;编译固件&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Most users will not need to build this firmware! It is pre-built and automatically installed by <em>QGroundControl</em> when appropriate hardware is connected.</p></div><p>To <a href="./../dev_setup/building_px4.html">build PX4</a> for this target:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="debug调试端口" tabindex="-1">Debug调试端口 <a class="header-anchor" href="#debug调试端口" aria-label="Permalink to &quot;Debug调试端口&quot;">​</a></h2><p>The <a href="./../debug/system_console.html">PX4 System Console</a> and <a href="./../debug/swd_debug.html">SWD interface</a> operate on the <strong>FMU Debug</strong> port. Simply connect the FTDI cable to the Debug &amp; F7 SWD connector. To access the I/O Debug port, the user must remove the CUAV v5 shell. Both ports have standard serial pins and can be connected to a standard FTDI cable (3.3V, but 5V tolerant).</p><p>The pinout is as shown.</p><p><img src="'+o+'" alt="CUAV v5 debug"></p><table><thead><tr><th>针脚</th><th>CUAV v5 debug</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>FMU-swclk</td></tr><tr><td>3</td><td>FMU-SWDIO</td></tr><tr><td>4</td><td>UART7_RX</td></tr><tr><td>5</td><td>UART7_TX</td></tr><tr><td>6</td><td>VCC</td></tr></tbody></table><h2 id="serial-port-mapping" tabindex="-1">Serial Port Mapping <a class="header-anchor" href="#serial-port-mapping" aria-label="Permalink to &quot;Serial Port Mapping&quot;">​</a></h2><table><thead><tr><th>UART</th><th>设备</th><th>Port</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (flow control)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (flow control)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX is RC input from SBUS_RC connector</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><h2 id="外部设备" tabindex="-1">外部设备 <a class="header-anchor" href="#外部设备" aria-label="Permalink to &quot;外部设备&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">数字空速传感器</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">遥测无线电模块</a></li><li><a href="./../sensor/rangefinders.html">距离传感器</a></li></ul><h2 id="支持的平台-机身" tabindex="-1">支持的平台/机身 <a class="header-anchor" href="#支持的平台-机身" aria-label="Permalink to &quot;支持的平台/机身&quot;">​</a></h2><p>Any multicopter / airplane / rover or boat that can be controlled with normal RC servos or Futaba S-Bus servos. The complete set of supported configurations can be seen in the <a href="./../airframes/airframe_reference.html">Airframes Reference</a>.</p><h2 id="更多信息" tabindex="-1">更多信息 <a class="header-anchor" href="#更多信息" aria-label="Permalink to &quot;更多信息&quot;">​</a></h2><ul><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 reference design pinout</a>.</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5.html" target="_blank" rel="noreferrer">CUAV v5 docs</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github库</a></li></ul>',34);function b(g,f,v,_,P,S){const e=i("Badge");return p(),n("div",null,[u,s(e,{type:"info",text:"Discontinued"}),m])}const U=l(h,[["render",b]]);export{A as __pageData,U as default};
